// routes/Routes.js
import React from "react";
import { createBrowserRouter, RouterProvider } from "react-router-dom";
import MainLayout from "../Layout/Mainlayout";
import UserLayout from "../Layout/Userhomelayout";
import AdminLayout from "../Layout/Adminhomelayout";
import DeliveryLayout from "../Layout/Deliverylayout";
import RestaurantLayout from "../Layout/Restauranthomelayout";

import MainHome from "../pages/main/Main"; // Import Main Home
import UserHome from "../pages/user/Userhome";
import UserLogin from "../pages/user/Userlogin";
import UserSignup from "../pages/user/Usersignup";
import AdminHome from "../pages/admin/Adminhome";
import DeliveryHome from "../pages/delivery/Deliveryhome";
import RestaurantHome from "../pages/restaurant/Reshome";

const router = createBrowserRouter([
  {
    path: "/", // Root path for the MainLayout
    element: <MainLayout />,
    children: [
      { index: true, element: <MainHome /> }, // Default component for "/"
      { path: "login", element: <UserLogin /> }, // Login route
      { path: "signup", element: <UserSignup /> }, // Signup route
    ],
  },
  {
    path: "user",
    element: <UserLayout />,
    children: [
      { index: true, element: <UserHome /> },
      { path: "menu", element: <RestaurantMenu /> }, // Menu route
      { path: "orders", element: <RestaurantOrders /> }, // Orders route
      { path: "settings", element: <RestaurantSettings /> },
    ],
  },
  {
    path: "admin",
    element: <AdminLayout />,
    children: [
      { index: true, element: <AdminHome /> },
    ],
  },
  {
    path: "delivery",
    element: <DeliveryLayout />,
    children: [
      { index: true, element: <DeliveryHome /> },
    ],
  },
  {
    path: "restaurant",
    element: <RestaurantLayout />,
    children: [
      { index: true, element: <RestaurantHome /> },
    ],
  },
]);




const Routess = () => {
  return <RouterProvider router={router} />;
};

export default Routess;
